import axios from "axios";
import "./App.css";
import { Col, Row } from "react-bootstrap";
import { useEffect, useState } from "react";

async function sendHook() {
  try {
    const response = await axios.get("http://192.168.222.51:4000", {
      timeout: 2000,
    });
    return response.data;
  } catch (error) {
    return error.message;
  }
}

function App() {
  const [loadedData, setLoadedData] = useState("Pending...");

  function hookHandler() {
    setLoadedData("Pending...");
    async function fetchData() {
      const data = await sendHook();
      setLoadedData(data);
    }
    fetchData();
  }

  useEffect(hookHandler, []);

  return (
    <div className="App">
      <div className="container-fluid">
        <Row>
          <Col xxl={6}>
            <h1>controls</h1>
          </Col>
          <Col xxl={6}>
            <h1>msgs</h1>
          </Col>
        </Row>
      </div>
    </div>
  );
}

export default App;
